Studio: Wicked
Categories: Feature
Director: Bishop
Starring: Anna Morna , Kaylani Lei , Allie James , Addie Juniper , Belle Noire , Seth Gamble , TJ Cummings , Nick Jacobs , Giovanni Francisco , Romio Price

When a job assignment takes Courtney out of town for a few months, she returns to find that James, her childhood best friend, is engaged. Naturally, she's happy for her best friend, but things get a little complicated once the two realize that their friendship might actually be true love. With the wedding right around the corner - their relationship will change forever as they ask themselves... are we in love or just friends?

